var PokemonObject = function(id,name,url){
    this.id=id;
    this.name=name;
    this.url=url;
    }
    const listpokemons =[];
 const Pokemon=  function (pokemons){
        for(var position in pokemons){
               listpokemons[position]=new PokemonObject(position,pokemons[position].name,pokemons[position].url);
        }
      }



      for( var position in pokemons){
        console.log(listpokemons[position]);
    }

      export default Pokemon;
